import { chat } from "./input-styles";

export default function data(){
    return(
    <chat>
        <div className="room-name">
            Sala<span className="colon">:</span> <input type="text" id="name"/>
        </div>
        <div className="Nick">
            Nick<span className="colon">:</span> <input type="text" id="pasword"/>
        </div>
    </chat>
    );
}
